import React from "react";
import style from "./TodoForm.module.css";
export default function TodoForm() {
  return (
    <div className={style.form}>
      <h1>Todo App</h1>
      <input type='text' placeholder='Input your todo' />
      <button type='submit'>Add to list</button>
    </div>
  );
}
